import React, { Component } from "react";
import Logo from "../../assets/logo.svg";

import { Container, Form } from "./styles";
import Input from "../../components/Input";

export default class CreateAccount extends Component {
  state = {
    user: {
      name: ""
    }
  };

  render() {
    return (
      <Container>
        <Form>
          <img src={Logo} alt="Osc-logo" />
          <label>
            <p>Nome:</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </label>

          <label>
            <p>Sobrenome:</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </label>
          <span>
            <label>
              <p>rg</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.name}
              />
            </label>
            <label>
              <p>Org√£o expedidor</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.name}
              />
            </label>
          </span>
          <span>
            <label>
              <p>uf</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.name}
              />
            </label>
            <label>
              <p>data de nascimento</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.name}
              />
            </label>
          </span>
          <label>
            <p>cpf</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </label>
          <label>
            <p>email</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </label>
          <label>
            <p>telefone</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </label>
          <label>
            <p>senha</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.name}
            />
          </label>
        </Form>
      </Container>
    );
  }
}
